css:
.timecop {
  overflow: auto;
}
.timecop .timecop-panel {
  background-color: #232323;
}
.timecop .panels {
  display: flex;
  flex-direction: row;
}
.timecop .package-panel {
  display: flex;
  flex-direction: row;
  flex: 1;
}
.timecop .package-panel .list-group {
  overflow: hidden;
}
.timecop .package-panel .inset-panel {
  width: 100%;
}
.timecop .text-info {
  margin-bottom: 6px;
}
.timecop .timing,
.timecop .list-item {
  display: flex;
  justify-content: space-between;
}
.timecop .timing .inline-block:last-child,
.timecop .list-item .inline-block:last-child {
  margin-right: 0;
}
.timecop .timing {
  margin-bottom: 6px;
}
.timecop .list-item {
  margin-top: 3px;
  margin-bottom: 3px;
}
.timecop .package {
  color: rgba(255, 255, 255, 0.8);
}
.timecop .package:hover {
  text-decoration: none;
  color: #cf5c3f;
}
.timecop .timecop-line {
  flex: 1 1 0;
  margin-right: 6px;
  margin-top: 0.8em;
  border-top: 1px dashed rgba(255, 255, 255, 0.2);
}
.timecop .package:hover + .timecop-line {
  border-color: rgba(255, 255, 255, 0.6);
}
